column27:
Nanoparticles were splitted into training and test set (18 and
  6 compounds, respectively) in the following way - the splitting of the dataset to training and test sets fulfilled three conditions: 
  (1)metal oxides from each activity group should be presented in both training and test sets; 
  (2) metal oxides presented in the test set should cover all types of oxides (MeO, Me2O3, MeO2), similarly to the training set; 
  (3) the list of oxides in each test set should be identical for both toxicity endpoints.

Nanoparticles were splitted into training and test set (18 and
  6 compounds, respectively) in the following way - the splitting of the dataset to training and test sets fulfilled three conditions: 
  (1)metal oxides from each activity group should be presented in both training and test sets; 
  (2) metal oxides presented in the test set should cover all types of oxides (MeO, Me2O3, MeO2), similarly to the training set; 
  (3) the list of oxides in each test set should be identical for both toxicity endpoints.

Six random distributions of the available data into training and calibration sets (these metal oxide nanoparticles are used to build up the model) and validation set (these metal oxide nanoparticles are not involved to build up the model, they are used to check up predictability of the model) are examined. All these splits are prepared according to the following principles:
  (i) they are random; 
  (ii) the range of endpoints in each sub-set is similar to ranges for other sub-sets; 
  (iii) these splits are not identical (Table 1 in the publication)

Nanoparticles were splitted into training and test set in the following way - the splitting of the dataset to training and test sets fulfilled three conditions: 

  (1)metal oxides from each activity group should be presented in both training and test sets; 
  (2) metal oxides presented in the test set should cover all types of oxides (MeO, Me2O3, MeO2), similarly to the training set; 
  (3) the list of oxides in each test set should be identical for both toxicity endpoints.

According to the following principles: 
  (i) the split is random keeping the highest and lowest toxic NPs in the training set;
  (ii) the test set NPs should lie within the chemical space occupied by the training set NPs and cover all types of oxides (MeO, MeO2, Me2O3)

The total set of available data has been split (three times) into the training (n = 22), calibration (n = 5), and validation (n = 5) sets.

  These splits are built up according to principles: 
  (i) these splits are random;
  (ii) the ranges of endpoints are similar for each sub-set (i.e. for the training, calibration, and validation set);
  (iii) these splits are different. It is possible to notice that there is a good balance of cytotoxicity data between the two sets of values

