column27:
In order to demonstrate the structural diversity of this data set, it was performed a hierarchical cluster analyses (CA) of these chemicals. According to the results of hierarchical cluster analyses, all the data were divided into a training set of 21 compounds to develop the model and a test set of 6 compounds to evaluate the model based on two rules: 
  1) the range of the solubility values of both the training set and the test set should be covered fromthe lowest to the highest; 
  2) the linking distances corresponding to the training set in the dendrogram, should not be out of themain clusters.
